import React from 'react';
import Navigation from './Navigation';

const Layout = ({children})=>{
    return(
        <>
            <Navigation />
            <div>
                {children}
            </div>

            <style jsx>{`
            *{
                height: 80vh;
                width: 100%;
                background-color: #917C5DFF;
            }
            body{
                background-color: red;
            }
        `}</style>
        </>
    )
}
export default Layout;
